    /** Timeout for shift tests. Solution takes 4ms. */
    private static final int POSITION_SHIFT_TEST_TIMEOUT = 800;

    /**
     * Test position shifts with pre-computed results.
     */
    @Test(timeOut = POSITION_SHIFT_TEST_TIMEOUT)
    public void testPositionShifts() {
        for (Map.Entry<PositionShiftTestInput, int[][]> precomputedInput : //
        PRECOMPUTED_POSITION_SHIFT_RESULTS.entrySet()) {

            PositionShiftTestInput input = precomputedInput.getKey();
            int[][] copyOfInput = input.inputArray.clone();
            int[][] expectedOutput = precomputedInput.getValue();
            int[][] actualOutput = null;

            if (input.shiftLeft > 0) {
                actualOutput = Transform.shiftLeft(input.inputArray, input.shiftLeft);
            } else if (input.shiftRight > 0) {
                actualOutput = Transform.shiftRight(input.inputArray, input.shiftRight);
            } else if (input.shiftUp > 0) {
                actualOutput = Transform.shiftUp(input.inputArray, input.shiftUp);
            } else if (input.shiftDown > 0) {
                actualOutput = Transform.shiftDown(input.inputArray, input.shiftDown);
            }

            Assert.assertTrue(Arrays.deepEquals(actualOutput, expectedOutput),
                    "Position shift output mismatch: " + Arrays.deepToString(expectedOutput) //
                            + "\n!=\n" + Arrays.deepToString(actualOutput));
            Assert.assertTrue(Arrays.deepEquals(input.inputArray, copyOfInput),
                    "Input array was modified");
        }
    }

