    /********************************************************************
     * Rotate and flip tests.
     ********************************************************************/

    /** Timeout for rotate and flip tests. Solution takes 8 ms. */
    private static final int ROTATE_AND_FLIP_TEST_TIMEOUT = 1600;

    /**
     * Test rotation and flips with pre-computed results.
     */
    @Test(timeOut = ROTATE_AND_FLIP_TEST_TIMEOUT)
    public void testRotateAndFlip() {
        for (Map.Entry<RotateAndFlipTestInput, int[][]> precomputedInput : //
        PRECOMPUTED_ROTATE_OR_FLIP_RESULTS.entrySet()) {

            RotateAndFlipTestInput input = precomputedInput.getKey();
            int[][] copyOfInput = input.inputArray.clone();
            int[][] expectedOutput = precomputedInput.getValue();
            int[][] actualOutput = null;

            if (input.rotateLeft) {
                actualOutput = Transform.rotateLeft(input.inputArray);
            } else if (input.rotateRight) {
                actualOutput = Transform.rotateRight(input.inputArray);
            } else if (input.flipVertical) {
                actualOutput = Transform.flipVertical(input.inputArray);
            } else if (input.flipHorizontal) {
                actualOutput = Transform.flipHorizontal(input.inputArray);
            }

            Assert.assertTrue(Arrays.deepEquals(actualOutput, expectedOutput),
                    "Rotate and flip output mismatch: " + Arrays.deepToString(expectedOutput) //
                            + "\n!=\n" + Arrays.deepToString(actualOutput));
            Assert.assertTrue(Arrays.deepEquals(input.inputArray, copyOfInput),
                    "Input array was modified");
        }
    }

