    /**
     * Class for storing inputs to rotation and flip test.
     */
    @SuppressWarnings("checkstyle:visibilitymodifier")
    public static class RotateAndFlipTestInput {
        /** Left rotation. */
        public boolean rotateLeft;

        /** Right rotation. */
        public boolean rotateRight;

        /** Vertical flip. */
        public boolean flipVertical;

        /** Horizontal shift. */
        public boolean flipHorizontal;

        /** Original input array. */
        public int[][] inputArray;

        /**
         * Create a input for the rotate and flip tests.
         *
         * @param setRotateLeft whether to rotate left
         * @param setRotateRight whether to rotate right
         * @param setFlipVertical whether to flip vertically
         * @param setFlipHorizontal whether to flip horizontally
         * @param setOutput the result
         */
        public RotateAndFlipTestInput(final boolean setRotateLeft, final boolean setRotateRight,
                final boolean setFlipVertical, final boolean setFlipHorizontal,
                final int[][] setOutput) {
            this.rotateLeft = setRotateLeft;
            this.rotateRight = setRotateRight;
            this.flipVertical = setFlipVertical;
            this.flipHorizontal = setFlipHorizontal;
            this.inputArray = setOutput;
        }
    }

    /********************************************************************
     * Color shift tests.
     ********************************************************************/

    /** Timeout for color shift tests. Solution takes 12 ms. */
    private static final int COLOR_SHIFT_TEST_TIMEOUT = 2400;

    /**
     * Test color shifts with pre-computed results.
     */
    @Test(timeOut = COLOR_SHIFT_TEST_TIMEOUT)
    public void testColorShift() {
        for (Map.Entry<ColorShiftTestInput, int[][]> precomputedInput : //
        PRECOMPUTED_COLOR_SHIFT_RESULTS.entrySet()) {

            ColorShiftTestInput input = precomputedInput.getKey();
            int[][] copyOfInput = input.inputArray.clone();
            int[][] expectedOutput = precomputedInput.getValue();
            int[][] actualOutput = null;

            if (input.redShift > 0) {
                actualOutput = Transform.moreRed(input.inputArray, input.redShift);
            } else if (input.redShift < 0) {
                actualOutput = Transform.lessRed(input.inputArray, -input.redShift);
            } else if (input.greenShift > 0) {
                actualOutput = Transform.moreGreen(input.inputArray, input.greenShift);
            } else if (input.greenShift < 0) {
                actualOutput = Transform.lessGreen(input.inputArray, -input.greenShift);
            } else if (input.blueShift > 0) {
                actualOutput = Transform.moreBlue(input.inputArray, input.blueShift);
            } else if (input.blueShift < 0) {
                actualOutput = Transform.lessBlue(input.inputArray, -input.blueShift);
            } else if (input.alphaShift > 0) {
                actualOutput = Transform.moreAlpha(input.inputArray, input.alphaShift);
            } else if (input.alphaShift < 0) {
                actualOutput = Transform.lessAlpha(input.inputArray, -input.alphaShift);
            }

            Assert.assertTrue(Arrays.deepEquals(actualOutput, expectedOutput),
                    "Color shift output mismatch: " + Arrays.deepToString(expectedOutput) //
                            + "\n!=\n" + Arrays.deepToString(actualOutput));
            Assert.assertTrue(Arrays.deepEquals(input.inputArray, copyOfInput),
                    "Input array was modified");
        }
    }

