    /**
     * Class for storing inputs to color shift tests.
     */
    @SuppressWarnings("checkstyle:visibilitymodifier")
    public static class ColorShiftTestInput {
        /** Red shift. */
        public int redShift;

        /** Green shift. */
        public int greenShift;

        /** Blue shift. */
        public int blueShift;

        /** Alpha shift. */
        public int alphaShift;

        /** Original input array. */
        public int[][] inputArray;

        /**
         * Create a input for the color shift tests.
         *
         * @param setRedShift amount to shift the red channel by
         * @param setGreenShift amount to shift the green channel by
         * @param setBlueShift amount to shift the blue channel by
         * @param setAlphaShift amount to shift the alpha channel by
         * @param setOutput the result
         */
        public ColorShiftTestInput(final int setRedShift, final int setGreenShift,
                final int setBlueShift, final int setAlphaShift,
                final int[][] setOutput) {
            this.redShift = setRedShift;
            this.greenShift = setGreenShift;
            this.blueShift = setBlueShift;
            this.alphaShift = setAlphaShift;
            this.inputArray = setOutput;
        }
    }

    /********************************************************************
     * Shrink and expand tests.
     ********************************************************************/

    /** Timeout for shrink and expand tests. Solution takes 10 ms. */
    private static final int SHRINK_OR_EXPAND_TEST_TIMEOUT = 2000;

    /**
     * Test valid shrinks and expansions with pre-computed results.
     */
    @Test(timeOut = SHRINK_OR_EXPAND_TEST_TIMEOUT)
    public void testShrinkOrExpand() {
        for (Map.Entry<ShrinkOrExpandTestInput, int[][]> precomputedInput : //
        PRECOMPUTED_EXPAND_OR_SHRINK_RESULTS.entrySet()) {

            ShrinkOrExpandTestInput input = precomputedInput.getKey();
            int[][] copyOfInput = input.inputArray.clone();
            int[][] expectedOutput = precomputedInput.getValue();
            int[][] actualOutput = null;

            if (input.shrinkVertical > 0) {
                // Temporary fix for problems with test suite
                continue;
            } else if (input.expandVertical > 0) {
                actualOutput = Transform.expandVertical(input.inputArray, input.expandVertical);
            } else if (input.shrinkHorizontal > 0) {
                // Temporary fix for problems with test suite
                continue;
            } else if (input.expandHorizontal > 0) {
                actualOutput = Transform.expandHorizontal(input.inputArray, input.expandHorizontal);
            }

            Assert.assertTrue(Arrays.deepEquals(actualOutput, expectedOutput),
                    "Shrink or expand output mismatch: " + Arrays.deepToString(expectedOutput) //
                            + "\n!=\n" + Arrays.deepToString(actualOutput));
            Assert.assertTrue(Arrays.deepEquals(input.inputArray, copyOfInput),
                    "Input array was modified");
        }
    }

