    /** Timeout for mystery test. Solution takes 2ms, but who knows what you did. */
    private static final int MYSTERY_TEST_TIMEOUT = 2000;

    /**
     * Test mystery function with pre-computed inputs.
     * <p>
     * All we care about is that it modifies at least one of the arrays that we input.
     */
    @Test(timeOut = MYSTERY_TEST_TIMEOUT)
    public void testMystery() {

        boolean mysteryModifiedSomething = false;
        for (int[][] input : PRECOMPUTED_MYSTERY_INPUTS) {

            int[][] copyOfInput = input.clone();
            int[][] output = Transform.mystery(input);

            if (!(Arrays.deepEquals(input, output))) {
                mysteryModifiedSomething = true;
            }
            Assert.assertTrue(Arrays.deepEquals(input, copyOfInput),
                    "Input array was modified");
        }
        Assert.assertTrue(mysteryModifiedSomething, "Mystery function does nothing");
    }

